import type { FC } from "react";
import {UserAddOutlined,DesktopOutlined,LogoutOutlined} from "@ant-design/icons"

const Profile: FC = () => {
  return <div className=" mt-5 m-auto w-[80%]">
    <div className=" mt-5 min-w-[310px] bg-[#F5F5F5] p-[15px]  h-fit ">
      <h3 className="hover:text-[#46A358] ">
        <UserAddOutlined className="gap-2" />
        Ma'lumotlarim</h3>
      <h3 className="hover:text-[#46A358] ">Tajribalarim</h3>
      <h3 className="hover:text-[#46A358] ">Sertifikatlarim</h3>
      <h3 className="hover:text-[#46A358] "> <DesktopOutlined />Qurilmalarim</h3>
      <h3 className="hover:text-[#46A358] "> <LogoutOutlined />Chiqish</h3>

    </div>
  </div>;
};

export default Profile;
